#targetisa "subrisc-delaybranch";

section macros{
	macro MCR_LoadImm(reg_dest, immediate)
	{
		mr -1, $PC, reg_dest;
			imm immediate;
	}
	macro MCR_ShiftR8(reg_value)
	{
shr reg_value, 8, reg_value;
/*		
		xan reg_value, $INC, reg_value;
		xan reg_value, $INC, reg_value;
		xan reg_value, $INC, reg_value;
		xan reg_value, $INC, reg_value;
		xan reg_value, $INC, reg_value;
		xan reg_value, $INC, reg_value;
		xan reg_value, $INC, reg_value;
		xan reg_value, $INC, reg_value;
		*/
	}
	macro MCR_Mask(reg_value, reg_mask, reg_dest, reg_tmp)
	{ //Takes 3 or 4 cycles
		//Shift right, obtain LSB, and compute nagative one
		xan reg_value, reg_mask, reg_dest -< jlsb L_lsb0;
			sub reg_dest, $Z, reg_tmp; //delay branch slot

		//Set LSB to 1
		sub $INC, reg_dest, reg_dest; //for one having 1 on LSB

		//Perform left shifting by 1
	L_lsb0:
		sub reg_tmp, reg_dest, reg_dest;
	}
	macro MCR_MaskNegative(reg_value, reg_mask, reg_dest, reg_tmp)
	{ //Takes 3 or 4 cycles
		xan reg_value, reg_mask, reg_dest;
		
		//Shift right, obtain LSB, and compute nagative one
		/*xan reg_value, reg_mask, reg_dest -< jlsb L_lsb0;
			sub reg_dest, $Z, reg_tmp; //delay branch slot

		//Set LSB to 1
		sub $INC, reg_dest, reg_dest; //for one having 1 on LSB

		//Perform left shifting by 1
	L_lsb0:
		sub reg_dest, reg_tmp, reg_dest;
		*/
	}
	macro MCR_FillZero4Words(reg_contains_addr, reg_conatins_value)
	{
		mw 0, reg_contains_addr, reg_conatins_value; //for index 0
		mw -2, reg_contains_addr, reg_conatins_value; //for index 1
		mw -4, reg_contains_addr, reg_conatins_value; //for index 2
		mw -6, reg_contains_addr, reg_conatins_value; //for index 3
	}
}

