/*
SubRISC Register Specification
	opA	opB
$ra x	o
$sp	x	o
$v0	x	o
$v1	x	o
$a0	o	o
...
$a3	o	o
$m0	o	o
$m1	o	o
$t0	o	o
...
$t5	o	o
*/

section main{
	.startup
	.symbol REG_NegativeBlockCount := $t4;
	.symbol REG_Negative16 := $t4;
	.symbol REG_BlockBufferGenerationPtr := $m0;
	~MCR_LoadImm(REG_NegativeBlockCount, -16);
	~MCR_LoadImm(REG_BlockBufferGenerationPtr, BLOCK_BUFFER_GENERATION_HEAD);

	blocking_phase
	{
		//Un-negatable register mapping
		.symbol REG_srcBufPtr := $v0;
		.symbol REG_dstBufPtr := $sp;
		.symbol REG_lineBufHead := $ra;
		.symbol REG_lineBufPtr := $v1;
		//Negatable register mapping
		.symbol REG_y := $a0;
		.symbol REG_yInBlk := $a1;
		.symbol REG_blkx := $a2;
		//.symbol REG_x := $a3;
		.symbol REG_tmpres := $a3;
		.symbol REG_NegativeBlockSize := $t5;
		.symbol REG_255 := $t0;
		.symbol REG_lineBufCurValue := $t2;
		.symbol REG_pxVal := $t1;
		.symbol REG_tmp := $t3;
		
		//Load constant values
		~MCR_LoadImm(REG_NegativeBlockSize, -8);
		~MCR_LoadImm(REG_255, 255);
		~MCR_LoadImm(REG_srcBufPtr, IMAGE_BUFFER_HEAD);
		~MCR_LoadImm(REG_lineBufHead, BLOCK_LINEBUFFER_HEAD);

		//Determine destination address
		{
			mr 0, REG_BlockBufferGenerationPtr, REG_tmp;
			sub REG_tmp, $Z, REG_tmp -< jneg L_BufGen1;
				sub $Z, REG_tmp, REG_tmp; //Delay-branch (execed always)
		L_BufGen0:
			~MCR_LoadImm(REG_dstBufPtr, BLOCK_BUFFER0_HEAD);
			sub $Z, $INC, REG_tmp -< jneg L_BufGenJoin; //Uncond jump
				sub $Z, REG_tmp, REG_tmp; //Delay-branch DDA (execed by 50%)
		L_BufGen1:
			~MCR_LoadImm(REG_dstBufPtr, BLOCK_BUFFER1_HEAD);
			//Can do same thing as upper delay-branch slot DDA
		}
	L_BufGenJoin:
		
		//Loop for all pixels in blocks
		//LoopBlock y : (-BlockCount)~(-1)
		sub $Z, REG_NegativeBlockCount, REG_y;
		loop_for_y
		{
			//Clear line buffer (for 128px/8(px/blk)=16 elements)
			//!!ATTENTION!! LOOP IS UNROLLED
			sub $Z, $Z, REG_tmp;
			~MCR_FillZero4Words(REG_lineBufHead, REG_tmp); //Fill zero from head
			sub REG_Negative16, REG_lineBufHead, REG_lineBufPtr; //Compute address of 4th element.
			~MCR_FillZero4Words(REG_lineBufPtr, REG_tmp);
			sub REG_Negative16, REG_lineBufPtr, REG_lineBufPtr; //Step pointer by 4 words
			~MCR_FillZero4Words(REG_lineBufPtr, REG_tmp);
			sub REG_Negative16, REG_lineBufPtr, REG_lineBufPtr; //Step pointer by 4 words
			~MCR_FillZero4Words(REG_lineBufPtr, REG_tmp);
			
			//LoopBlock yInBlk : (-BlockSize)~(-1)
			sub $Z, REG_NegativeBlockSize, REG_yInBlk;
			loop_for_yInBlk
			{
				//Redraw line buffer pointer to its head
				sub $Z, REG_lineBufHead, REG_lineBufPtr;

				//LoopBlock blkx : (-BlockCount)~(-1)
				sub $Z, REG_NegativeBlockCount, REG_blkx;
				loop_for_blkx
				{
					//Pick up block summation from line buffer
					mr 0, REG_lineBufPtr, REG_lineBufCurValue;
					
					//LoopBlock x : (-BlockSize)~(-1)
					//!!ATTENTION!! LOOP IS UNROLLED
					loop_for_x
					{
						//Load a word of image pixels and add to curValue (containing 4 pixels idx.0 ~ idx.3)
						mr 0, REG_srcBufPtr, REG_pxVal;
						{
							~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmp, REG_tmp);
							sub REG_tmp, $Z, REG_tmp;

							~MCR_ShiftR8(REG_pxVal);
							~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmpres, REG_tmp);
							sub REG_tmpres, REG_tmp, REG_tmp;

							~MCR_ShiftR8(REG_pxVal);
							~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmpres, REG_tmp);
							sub REG_tmpres, REG_tmp, REG_tmp;
							
							~MCR_ShiftR8(REG_pxVal);
							//~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmpres, REG_tmp);
							sub REG_pxVal, REG_tmp, REG_tmp;
						}
						sub $NFOUR, REG_srcBufPtr, REG_srcBufPtr; //Step to next word
						
						//Load a word of image pixels and add to curValue (containing 4 pixels idx.4 ~ idx.7)
						mr 0, REG_srcBufPtr, REG_pxVal;
						{
							~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmpres, REG_tmp);
							sub REG_tmpres, REG_tmp, REG_tmp;

							~MCR_ShiftR8(REG_pxVal);
							~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmpres, REG_tmp);
							sub REG_tmpres, REG_tmp, REG_tmp;

							~MCR_ShiftR8(REG_pxVal);
							~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmpres, REG_tmp);
							sub REG_tmpres, REG_tmp, REG_tmp;
							
							~MCR_ShiftR8(REG_pxVal);
							//~MCR_MaskNegative(REG_pxVal, REG_255, REG_tmpres, REG_tmp);
							sub REG_pxVal, REG_tmp, REG_tmp;
						}
						sub REG_tmp, REG_lineBufCurValue, REG_lineBufCurValue;

						sub $NFOUR, REG_srcBufPtr, REG_srcBufPtr; //Step to next word
					}
					//!!ATTENTION!! LOOP IS UNROLLED
					//End of LoopBlock---

					//Store summation to line buffer
					mw 0, REG_lineBufPtr, REG_lineBufCurValue;
					sub $NFOUR, REG_lineBufPtr, REG_lineBufPtr;
				}
				sub $INC, REG_blkx, REG_blkx-< jneg loop_for_blkx;
					sub $Z, REG_tmp, REG_tmp; //Delay branch slot
				//End of LoopBlock---
			}
			sub $INC, REG_yInBlk, REG_yInBlk -< jneg loop_for_yInBlk;
				sub $Z, REG_tmp, REG_tmp; //???‚±‚±‚ç•Ó‚Ì’x‰„•ªŠòƒXƒƒbƒg‚à–„‚ß‚È‚­‚Ä‚Í //Delay branch slot
			//End of LoopBlock---
			
			//Write line buffer contents to global variable
			//LoopBlock blkx : (-BlockSize)~(-1)
			//sub $Z, REG_NegativeBlockSize, REG_blkx;
			//!!ATTENTION!! LOOP IS UNROLLED
			loop_for_blkx
			{
				//Copy line buffer to blocks variable
				mr 0, REG_lineBufHead, REG_tmp;
				mw 0, REG_dstBufPtr, REG_tmp;
				mr -2, REG_lineBufHead, REG_tmp;
				mw -2, REG_dstBufPtr, REG_tmp;
				mr -4, REG_lineBufHead, REG_tmp;
				mw -4, REG_dstBufPtr, REG_tmp;
				mr -6, REG_lineBufHead, REG_tmp;
				mw -6, REG_dstBufPtr, REG_tmp;

				//4-7
				sub REG_Negative16, REG_lineBufHead, REG_lineBufPtr;
				sub REG_Negative16, REG_dstBufPtr, REG_dstBufPtr;
				mr 0, REG_lineBufPtr, REG_tmp;
				mw 0, REG_dstBufPtr, REG_tmp;
				mr -2, REG_lineBufPtr, REG_tmp;
				mw -2, REG_dstBufPtr, REG_tmp;
				mr -4, REG_lineBufPtr, REG_tmp;
				mw -4, REG_dstBufPtr, REG_tmp;
				mr -6, REG_lineBufPtr, REG_tmp;
				mw -6, REG_dstBufPtr, REG_tmp;
				
				//8-11
				sub REG_Negative16, REG_lineBufPtr, REG_lineBufPtr;
				sub REG_Negative16, REG_dstBufPtr, REG_dstBufPtr;
				mr 0, REG_lineBufPtr, REG_tmp;
				mw 0, REG_dstBufPtr, REG_tmp;
				mr -2, REG_lineBufPtr, REG_tmp;
				mw -2, REG_dstBufPtr, REG_tmp;
				mr -4, REG_lineBufPtr, REG_tmp;
				mw -4, REG_dstBufPtr, REG_tmp;
				mr -6, REG_lineBufPtr, REG_tmp;
				mw -6, REG_dstBufPtr, REG_tmp;

				//12-15
				sub REG_Negative16, REG_lineBufPtr, REG_lineBufPtr;
				sub REG_Negative16, REG_dstBufPtr, REG_dstBufPtr;
				mr 0, REG_lineBufPtr, REG_tmp;
				mw 0, REG_dstBufPtr, REG_tmp;
				mr -2, REG_lineBufPtr, REG_tmp;
				mw -2, REG_dstBufPtr, REG_tmp;
				mr -4, REG_lineBufPtr, REG_tmp;
				mw -4, REG_dstBufPtr, REG_tmp;
				mr -6, REG_lineBufPtr, REG_tmp;
				mw -6, REG_dstBufPtr, REG_tmp;

				//16
				sub REG_Negative16, REG_dstBufPtr, REG_dstBufPtr;
			}
			//sub $INC, REG_blkx, REG_blkx-< jneg loop_for_blkx;
			//	//Delay branch slot
			//End of LoopBlock---
		}
		sub $INC, REG_y, REG_y -< jneg loop_for_y;
			sub $Z, REG_tmp, REG_tmp; //Delay branch slot
		//End of LoopBlock---
	}

	{
		.symbol REG_tmpBlkHead := $t5;
	
		difference_block
		{		
			//Un-negatable register mapping
			.symbol REG_resBlkPtr := $v0;
			.symbol REG_srcBlkPtr := $v1;
			.symbol REG_resValMove := $sp;
			.symbol REG_resValStop := $ra;
			//Negatable register mapping
			.symbol REG_i := $a0;
			.symbol REG_THRESHOLD := $a1;
			.symbol REG_AllBlockCount := $a2;
			.symbol REG_tmp := $t0;
			.symbol REG_negDiff := $t1;
			.symbol REG_resBlkVal := $t2;
			.symbol REG_srcBlkVal := $t3;

			//sub $Z, $INC, $t0 -< jneg HALT;

			//Determine destination address
			{
				mr 0, REG_BlockBufferGenerationPtr, REG_tmp;
				sub REG_tmp, $Z, REG_tmp -< jneg L_BufGen1;
					sub $Z, REG_tmp, REG_tmp; //Delay-branch (execed always)
			L_BufGen0:
				~MCR_LoadImm(REG_tmpBlkHead, BLOCK_BUFFER1_HEAD);
				~MCR_LoadImm(REG_srcBlkPtr, BLOCK_BUFFER0_HEAD);
				sub $Z, $INC, REG_tmp -< jneg L_BufGenJoin; //Uncond jump
					sub $Z, REG_tmp, REG_tmp; //Delay-branch DDA (execed by 50%)
			L_BufGen1:
				~MCR_LoadImm(REG_tmpBlkHead, BLOCK_BUFFER0_HEAD);
				~MCR_LoadImm(REG_srcBlkPtr, BLOCK_BUFFER1_HEAD);
				//Can do same thing as upper delay-branch slot DDA
			}
		L_BufGenJoin:

			//Load constant values
			~MCR_LoadImm(REG_AllBlockCount, -256);
			sub $Z, REG_tmpBlkHead, REG_resBlkPtr;
			sub $DEC, $Z, REG_resValMove;
			sub $Z, $Z, REG_resValStop;
			~MCR_LoadImm(REG_THRESHOLD, CONST_NEG_THRESHOLD);
					
			//Loop for all pixels in blocks
			//LoopBlock i : (-AllBlockCount)~(-1)
			sub $Z, REG_AllBlockCount, REG_i;
			loop_for_i
			{
				//Load block values
				mr 0, REG_resBlkPtr, REG_resBlkVal;
				mr 0, REG_srcBlkPtr, REG_srcBlkVal;

				//Compute negative difference
				sub REG_srcBlkVal, REG_resBlkVal, REG_negDiff -< jneg L_DifNeg;
					sub $Z, REG_tmp, REG_tmp; //Delay-branch
				sub REG_negDiff, $Z, REG_negDiff;
			L_DifNeg:

				//Branch by threshold filter
				sub REG_THRESHOLD, REG_negDiff, REG_tmp -< jneg L_Moving;
					sub $Z, REG_tmp, REG_tmp; //Delay-branch
			L_Stopping:
				mw 0, REG_resBlkPtr, REG_resValStop;
				sub $NFOUR, REG_resBlkPtr, REG_resBlkPtr;
				sub $NFOUR, REG_srcBlkPtr, REG_srcBlkPtr;
				sub $INC, REG_i, REG_i -< jneg loop_for_i;
					sub $Z, REG_tmp, REG_tmp; //Delay branch slot
				sub $DEC, $Z, REG_tmp -< jneg dialate_block;
					sub $Z, REG_tmp, REG_tmp; //Delay branch slot

			L_Moving:
				mw 0, REG_resBlkPtr, REG_resValMove;
				sub $NFOUR, REG_resBlkPtr, REG_resBlkPtr;
				sub $NFOUR, REG_srcBlkPtr, REG_srcBlkPtr;
				sub $INC, REG_i, REG_i -< jneg loop_for_i;
					sub $Z, REG_tmp, REG_tmp; //Delay branch slot
			}
			//End of LoopBlock---
		}

		//REG_BlockBufferGenerationPtr has gone

		dialate_block
		{
			//Un-negatable register mapping
			.symbol REG_NegativeBlockCountPlus2 := $ra;
			.symbol REG_x := $sp;
			.symbol REG_resBlkPtr := $v0;
			.symbol REG_srcBlkPtr := $v1;
			//Negatable register mapping
			/*
			.symbol  := $a0;
			.symbol  := $a1;
			.symbol  := $a2;
			.symbol  := $a3;
			.symbol  := $t0;
			.symbol  := $t1;
			.symbol  := $t2;
			.symbol  := $t5;
			*/
			.symbol REG_y := $t4; //overriding REG_NegativeBlockCount REG_Negative16
			.symbol REG_NegativeStride := $t3;
			.symbol REG_PositiveStride := $m1;
			.symbol REG_NegativeBlockCountPlus1 := $m0; //overriding REG_BlockBufferGenerationPtr
			
			//Load constant values
			{
				//Compute block count

				//Compute buffer strides
				~MCR_LoadImm(REG_NegativeStride, BLOCK_NEGATIVE_STRIDE);
				sub REG_NegativeStride, $Z, REG_PositiveStride;

				//Compute source pointer addresses
				sub $Z, REG_tmpBlkHead, REG_srcBlkPtr;

				//Compute destination pointer address
				~MCR_LoadImm(REG_resBlkPtr, BLOCK_DETECT_RESULT_HEAD);
				
				//Compute length of blocks edge except for left and right side.
				sub $INC, REG_NegativeBlockCount, REG_NegativeBlockCountPlus1; //-BlockCount+1
				sub $INC, REG_NegativeBlockCountPlus1, REG_NegativeBlockCountPlus2;
			}
			
			//Loop for all pixels in blocks
			//LoopBlock y : (-BlockCount)~(-1)
			sub $Z, REG_NegativeBlockCount, REG_y;
			loop_for_y
			{
				.symbol REG_px_center := $a0;
				.symbol REG_px_left := $a1;
				.symbol REG_px_upcenter := $a2;
				.symbol REG_px_upleft := $a3;
				.symbol REG_px_dwcenter := $t1;
				.symbol REG_px_dwleft := $t2;
				.symbol REG_tmp := $t0; 
				.symbol REG_res := $t5; //overriding REG_tmpBlkHead

				//Do for a block on left side
				{
					//center
					mr 0, REG_srcBlkPtr, REG_px_left; 
					sub REG_px_left, $Z, REG_res;
					//right
					mr -2, REG_srcBlkPtr, REG_px_center;
					sub REG_px_center, REG_res, REG_res;

					//Check for UPPER pixel, posibbly skip, TopEdge=-BlockCount‚È‚Ì‚Å’ˆÓ
					sub REG_NegativeBlockCountPlus1, REG_y, REG_tmp -< jneg L_skipUpper;
						sub $Z, REG_tmp, REG_tmp; //Delay branch slot
					sub REG_PositiveStride, REG_srcBlkPtr, REG_tmp; //Compute up center address
					mr 0, REG_tmp, REG_px_upleft; //up
					sub REG_px_upleft, REG_res, REG_res;
					mr -2, REG_tmp, REG_px_upcenter; //up-right
					sub REG_px_upcenter, REG_res, REG_res;

				L_skipUpper:
					//Check for DOWN pixel, posibbly skip, BottomEdge=-1‚È‚Ì‚Å’ˆÓ
					//jcarry: jump if {1'b0,opb} - {1'b0,opa})[32] == 0 ;
					//             on opb >= opa
					//So for opb=REG_y, opa=$INC, jump on REG_y>=0xFFFFFFFF
					sub $INC, REG_y, REG_tmp -< jcarry L_skipDown;
						sub $Z, REG_tmp, REG_tmp; //Delay branch slot
					sub REG_NegativeStride, REG_srcBlkPtr, REG_tmp; //Compute down center address
					mr 0, REG_tmp, REG_px_dwleft; //down
					sub REG_px_dwleft, REG_res, REG_res;
					mr -2, REG_tmp, REG_px_dwcenter; //down-right
					sub REG_px_dwcenter, REG_res, REG_res;

				L_skipDown:
					//Summerize result
					mw 0, REG_resBlkPtr, REG_res;
					//Step pointers
					sub $NFOUR, REG_resBlkPtr, REG_resBlkPtr;
					sub $NFOUR, REG_srcBlkPtr, REG_srcBlkPtr;
				}

				//LoopBlock x : (BlockSize - 2) times 
				sub $Z, REG_NegativeBlockCountPlus2, REG_x;
				loop_for_x
				{
					//Add pixels loaded previous iteration
					sub REG_px_left, $Z, REG_res; //left
					sub REG_px_center, REG_res, REG_res; //center
					sub $Z, REG_px_center, REG_px_left;

					mr -2, REG_srcBlkPtr, REG_px_center; //right
					sub REG_px_center, REG_res, REG_res;

					//Check for UPPER pixel, posibbly skip, TopEdge=-BlockCount‚È‚Ì‚Å’ˆÓ
					sub REG_NegativeBlockCountPlus1, REG_y, REG_tmp -< jneg L_skipUpper;
						sub $Z, REG_tmp, REG_tmp; //Delay branch slot
					sub REG_PositiveStride, REG_srcBlkPtr, REG_tmp; //Compute up center address
					sub REG_px_upleft, REG_res, REG_res; //up-left
					sub REG_px_upcenter, REG_res, REG_res; //up-center
					sub $Z, REG_px_upcenter, REG_px_upleft;
					mr -2, REG_tmp, REG_px_upcenter; //up-right
					sub REG_px_upcenter, REG_res, REG_res;

				L_skipUpper:
					//Check for DOWN pixel, posibbly skip, BottomEdge=-1‚È‚Ì‚Å’ˆÓ
					//jcarry: jump if {1'b0,opb} - {1'b0,opa})[32] == 0 ;
					//             on opb >= opa
					//So for opb=REG_y, opa=$INC, jump on REG_y>=0xFFFFFFFF
					sub $INC, REG_y, REG_tmp -< jcarry L_skipDown;
						sub $Z, REG_tmp, REG_tmp; //Delay branch slot
					sub REG_NegativeStride, REG_srcBlkPtr, REG_tmp; //Compute down center address
					sub REG_px_dwleft, REG_res, REG_res; //down-left
					sub REG_px_dwcenter, REG_res, REG_res; //down-center
					sub $Z, REG_px_dwcenter, REG_px_dwleft;
					mr -2, REG_tmp, REG_px_dwcenter; //down-right
					sub REG_px_dwcenter, REG_res, REG_res;

				L_skipDown:
					//Summerize result
					mw 0, REG_resBlkPtr, REG_res;
					//Step pointers
					sub $NFOUR, REG_resBlkPtr, REG_resBlkPtr;
					sub $NFOUR, REG_srcBlkPtr, REG_srcBlkPtr;
				}
				sub $INC, REG_x, REG_x -< jneg loop_for_x;
					sub $Z, REG_tmp, REG_tmp; //Delay branch slot
				//End of LoopBlock---
				
				//Do for a block on right side
				{
					//Add pixels loaded previous iteration
					sub REG_px_left, $Z, REG_res; //left
					sub REG_px_center, REG_res, REG_res; //center

					//Check for UPPER pixel, posibbly skip, TopEdge=-BlockCount‚È‚Ì‚Å’ˆÓ
					sub REG_NegativeBlockCountPlus1, REG_y, REG_tmp -< jneg L_skipUpper;
						sub $Z, REG_tmp, REG_tmp; //Delay branch slot
					sub REG_PositiveStride, REG_srcBlkPtr, REG_tmp; //Compute up center address
					sub REG_px_upleft, REG_res, REG_res; //up-left
					sub REG_px_upcenter, REG_res, REG_res; //up-center
					sub $Z, REG_px_upcenter, REG_px_upleft;

				L_skipUpper:
					//Check for DOWN pixel, posibbly skip, BottomEdge=-1‚È‚Ì‚Å’ˆÓ
					//jcarry: jump if {1'b0,opb} - {1'b0,opa})[32] == 0 ;
					//             on opb >= opa
					//So for opb=REG_y, opa=$INC, jump on REG_y>=0xFFFFFFFF
					sub $INC, REG_y, REG_tmp -< jcarry L_skipDown;
						sub $Z, REG_tmp, REG_tmp; //Delay branch slot
					sub REG_NegativeStride, REG_srcBlkPtr, REG_tmp; //Compute down center address
					sub REG_px_dwleft, REG_res, REG_res; //down-left
					sub REG_px_dwcenter, REG_res, REG_res; //down-center
					sub $Z, REG_px_dwcenter, REG_px_dwleft;

				L_skipDown:
					//Summerize result
					mw 0, REG_resBlkPtr, REG_res;
					//Step pointers
					sub $NFOUR, REG_resBlkPtr, REG_resBlkPtr;
					sub $NFOUR, REG_srcBlkPtr, REG_srcBlkPtr;
				}
			}
			sub $INC, REG_y, REG_y -< jneg loop_for_y;
				sub $Z, $t0, $t0; //Delay branch slot
			//End of LoopBlock---
		}
	}

HALT:
	sub $Z, $INC, $ra -< jneg HALT;
		sub $Z, $t1, $t1;
}
